// src/pages/SettingsPage.jsx
import React from 'react';

function SettingsPage() {
  return (
    <div>
      <h2>Sistem Ayarları</h2>
      <p>Bu sayfada genel sistem ayarlarını yönetebilirsiniz.</p>
      <ul>
        <li>Sunucu Zaman Dilimi</li>
        <li>Admin Kullanıcı Yönetimi</li>
        <li>Güncelleme Saatleri (Otomatik)</li>
        <li>Yedekleme Planlaması</li>
      </ul>
      <p>
        İlerleyen aşamalarda bu ayarlar için formlar ve kaydetme işlevi
        eklenecektir.
      </p>
    </div>
  );
}

export default SettingsPage;
